import React from 'react'

function UserNames() {
    let users = ['yash', 'kumar' , 'chhipa', 'reporting', 'sir']
    return (
        <div>
            {
                users.map(names=>{
                return <h2>{names}</h2>
                })
            }
        </div>
    )
}

export default UserNames
